GpuHostAsyncWaiter::GpuHostAsyncWaiter(GpuHost* proxy)
    : proxy_(proxy)
{
}

GpuHostAsyncWaiter::~GpuHostAsyncWaiter() = default;

void GpuHostAsyncWaiter::GetIsolationKey(int32_t client_id, const ::blink::WebGPUExecutionContextToken& wgpu_context_token, std::string* out_isolation_key)
{
    base::RunLoop loop;
    proxy_->GetIsolationKey(std::move(client_id), std::move(wgpu_context_token),
        base::BindOnce(
            [](base::RunLoop* loop, std::string* out_isolation_key, const std::string& isolation_key) {
                *out_isolation_key = std::move(isolation_key);
                loop->Quit();
            },
            &loop, out_isolation_key));
    loop.Run();
}

std::string GpuHostAsyncWaiter::GetIsolationKey(int32_t client_id, const ::blink::WebGPUExecutionContextToken& wgpu_context_token)
{
    std::string async_wait_result;
    GetIsolationKey(std::move(client_id), std::move(wgpu_context_token), &async_wait_result);
    return async_wait_result;
}

